import { Switch, Route, Router } from 'react-router-dom';
import Login from './Login/index';

function App() {
  return (
    <div className='App'>
      <Router>
        <Switch>
          <Route exact path='/' component={Login} />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
